We Thought We Sold Out 🤯!!!
@kurtbinstagramming POP UP went well, so well in fact that EVERYTHING SOLD 🚀 Bittersweet for us because we always want to have an offering for our loyal IG followers! 
Luckily the buyer for this rare Chinoiserie & Woodgrain chillum didn’t follow through and we have it AVAILABLE to you now. Act fast if you want it, this will not last long👊 #kurtb #kurtbinstagramming #stokedct
